import React from 'react';
import './Projects.css';

const projects = [
    {
        title: 'Web Application Development',
        year: '2024',
        description: 'Developed the Web Application Development project using APIs and JavaScript.',
        image: '/webapp.png', // Replace with the actual path to the image
        image: '/', // Replace with the actual path to the image
    },
    {
        title: 'Suggested Jobs',
        year: '2020',
        description: 'Redesigning job recommendations based on job seeker activity.',
        image: '/path/to/suggested-jobs-image.png', // Replace with the actual path to the image
    },
    // Add more projects as needed
];

const Projects = () => {
    return (
        <div className="projects-container">
            {projects.map((project, index) => (
                <div key={index} className="project-card">
                    <div className="project-info">
                        <h2 className="project-title">{project.title}</h2>
                        <p className="project-year">{project.year}</p>
                        <p className="project-description">{project.description}</p>
                        <button className="read-more">Read More</button>
                    </div>
                    <div className="project-image">
                        <img src={project.image} alt={project.title} />
                    </div>
                </div>
            ))}
        </div>
    );
};

export default Projects;
